import react, {Fragment} from "react";
import NavBar from "./Components/NavBar";
import { Routes, Router } from 'react-router-dom';

function App() {



  return (
    <div>
        <Fragment>
          <Router>
            <Routes path='/'>
              <NavBar />

            </Routes>
          </Router>

        </Fragment>







    </div>
  );
}

export default App;
